let page = 1;

let totalPages = 1;
$(".np").on("click", function(){
    if(page < totalPages){
        page++;
        $(".card").remove();
        searchContent(page);
        $(".cur-page").text(page)
    }
})

$(".pp").on("click", function(){
    if(page != 1)
    {
        page--;
        $(".card").remove();
        searchContent(page);
        $(".cur-page").text(page)
    }
})


