function createDisplay(data)
{
    data.forEach(elem => {
        const name = `<h2> ${elem.name} </h2>`;
        const title = elem.title;
        let poster
        if(elem.backdrop_path != null){
            poster = `<img src="https://image.tmdb.org/t/p/w500/${elem.backdrop_path}" alt="backdrop">`
        }
        else{
            poster = "<img src='images/missing.png' alt='MISSING PICTURE'>"
        }
        const popul = `<span>Popularity: ${elem.popularity}</span>`
        const overview = `<p class="overview">${elem.overview} </p>`
        const release = `<time>Released: ${elem.release_date}</time>`
        const firstAir = `<time> First aired:${elem.first_air_date}</time>`

        if(title == null)
        {
            const card = `<div class="card">${poster} ${name} <hr> ${overview} <div class="info">${firstAir} ${popul} </div></div>`
            $(".holder").append(card)
        }
        else{
            const card = `<div class="card">${poster} <h2>${title}</h2> <hr> ${overview} <div class="info">${release} ${popul} </div> </div>`
            $(".holder").append(card)
        }
    })
}